import React from 'react';

function NavDrawer() {
	return (
		<header className="bg-gray-300 fixed w-full h-14 top-0 left-0">
			<nav className="flex items-center h-full px-2">
				<div></div>
				<div className="text-white text-lg"><a href="/">The LOGO</a></div>
				<div>
					<ul className="p">
						<li><a href="/">Products</a></li>
						<li><a href="/">Users</a></li>
					</ul>
				</div>
			</nav>
		</header>
	);
}

export default NavDrawer;
